import React from 'react'
import {
    Grid,
} from '@material-ui/core'

export default function AddBudgetDialog() {
    return (
        <div>
            <Grid container direction="column">
                <Grid item>
                    Enter budget name
                </Grid>
                <Grid item>
                    Select working days
                </Grid>
            </Grid>
        </div>
    )
}
